(1, 1, 'SMS Explained', '<p style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; margin: 0px 0px 1.5rem; font-family: &quot;Source Sans Pro&quot;, sans-serif; line-height: 1.75; color: rgb(33, 37, 41); font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Safety Management System (SMS) is becoming a standard throughout the aviation industry worldwide. It is recognized by the Joint Planning and Development Office (JPDO), International Civil Aviation Organization (ICAO), and civil aviation authorities (CAA) and product/service providers as the next step in the evolution of safety in aviation. SMS is also becoming a standard for the management of safety beyond aviation. Similar management systems are used in the management of other critical areas such as quality, occupational safety and health, security, environment, etc.</p><p style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; margin: 0px 0px 1.5rem; font-family: &quot;Source Sans Pro&quot;, sans-serif; line-height: 1.75; color: rgb(33, 37, 41); font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Safety Management Systems (SMSs) for product/service providers (certificate holders) and regulators will integrate modern safety risk management and safety assurance concepts into repeatable, proactive systems. SMSs emphasize safety management as a fundamental business process to be considered in the same manner as other aspects of business management.</p><p style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; margin: 0px 0px 1.5rem; font-family: &quot;Source Sans Pro&quot;, sans-serif; line-height: 1.75; color: rgb(33, 37, 41); font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">By recognizing the organization\'s role in accident prevention, SMSs provide to both certificate holders and FAA:</p><ul style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; margin: 0px 0px 1.5rem; color: rgb(33, 37, 41); font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><li style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; font-family: &quot;Source Sans Pro&quot;, sans-serif; line-height: 1.75; padding-left: 0.75rem;\">A structured means of safety risk management<span>&nbsp;</span><strong style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; font-weight: 600 !important;\"><em style=\"box-sizing: border-box; min-height: 0px; min-width: 0px;\">decision making</em></strong></li><li style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; font-family: &quot;Source Sans Pro&quot;, sans-serif; line-height: 1.75; padding-left: 0.75rem;\">A means of demonstrating safety<span>&nbsp;</span><strong style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; font-weight: 600 !important;\"><em style=\"box-sizing: border-box; min-height: 0px; min-width: 0px;\">management capability</em></strong><span>&nbsp;</span>before system failures occur</li><li style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; font-family: &quot;Source Sans Pro&quot;, sans-serif; line-height: 1.75; padding-left: 0.75rem;\">Increased confidence in<span>&nbsp;</span><strong style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; font-weight: 600 !important;\"><em style=\"box-sizing: border-box; min-height: 0px; min-width: 0px;\">risk controls</em></strong><span>&nbsp;</span>though structured<span>&nbsp;</span><strong style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; font-weight: 600 !important;\"><em style=\"box-sizing: border-box; min-height: 0px; min-width: 0px;\">safety assurance</em></strong><span>&nbsp;</span>processes</li><li style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; font-family: &quot;Source Sans Pro&quot;, sans-serif; line-height: 1.75; padding-left: 0.75rem;\">An effective interface for<span>&nbsp;</span><strong style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; font-weight: 600 !important;\"><em style=\"box-sizing: border-box; min-height: 0px; min-width: 0px;\">knowledge sharing</em></strong><span>&nbsp;</span>between regulator and certificate holder</li><li style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; font-family: &quot;Source Sans Pro&quot;, sans-serif; line-height: 1.75; padding-left: 0.75rem;\">A<span>&nbsp;</span><strong style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; font-weight: 600 !important;\"><em style=\"box-sizing: border-box; min-height: 0px; min-width: 0px;\">safety promotion</em></strong><span>&nbsp;</span>framework to support a sound<span>&nbsp;</span><strong style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; font-weight: 600 !important;\"><em style=\"box-sizing: border-box; min-height: 0px; min-width: 0px;\">safety culture</em></strong></li></ul><div class=\"table-responsive\" style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; display: block; width: 900px; overflow-x: auto; color: rgb(33, 37, 41); font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><table cellspacing=\"1\" class=\"table\" style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; border-collapse: collapse; width: 900px; margin-bottom: 2.5rem; color: rgb(33, 37, 41); border: none;\"><caption style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; padding-top: 0px; padding-bottom: 0px; color: rgb(52, 58, 64); text-align: center; caption-side: top; background: rgb(255, 255, 255); font-weight: bold; line-height: 1.5; margin: 0.5rem 0px;\">SMS Explained</caption><thead style=\"box-sizing: border-box; min-height: 0px; min-width: 0px;\"><tr style=\"box-sizing: border-box; min-height: 0px; min-width: 0px;\"><th scope=\"col\" style=\"box-sizing: border-box; min-height: 0px; min-width: 0px; text-align: -webkit-match-parent; border-top: none rgb(21, 57, 108); border-right: none rgb(21, 57, 108); border-bottom: 2px solid rgb(21, 57, 108); border-left: none rgb(21, 57, 108); border-image: initial; background-color: rgb(21, 57, 108); padding: 0.75rem 1rem; vertical-align: bottom; color: rgb(2