pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">We are one of Asia\'s top aviation-focused universities recognized as a leader in producing highly-competent and value-laden graduates who contribute to nation-building and global progress. </span></span></p><p style=\"box-sizing: border-box; margin: 0px 0px 26px; color: rgb(33, 33, 33); font-family: &quot;Exo 2&quot;, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(249, 249, 249); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><font face=\"Lato, Helvetica, Arial, Verdana, sans-serif\" color=\"#085294\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 15px;\"><b style=\"box-sizing: border-box; font-weight: bolder;\">CORE VALUES</b></span></font></p><p style=\"box-sizing: border-box; margin: 0px 0px 26px; color: rgb(33, 33, 33); font-family: &quot;Exo 2&quot;, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(249, 249, 249); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; line-height: 1;\"><span style=\"box-sizing: border-box; font-size: 15px; color: rgb(103, 107, 109); font-family: Lato, Helvetica, Arial, Verdana, sans-serif;\">-Christ-Centeredness: In everything that you do, in thought and action, you do it to glorify God</span></p><p style=\"box-sizing: border-box; margin: 0px 0px 26px; color: rgb(33, 33, 33); font-family: &quot;Exo 2&quot;, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(249, 249, 249); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; line-height: 1;\"><span style=\"box-sizing: border-box; color: rgb(103, 107, 109); font-family: Lato, Helvetica, Arial, Verdana, sans-serif; font-size: 15px;\">Servant-Leadership: Leading with humility and being supportive to peers</span></p><p style=\"box-sizing: border-box; margin: 0px 0px 26px; color: rgb(33, 33, 33); font-family: &quot;Exo 2&quot;, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(249, 249, 249); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; line-height: 1;\"><font color=\"#676b6d\" face=\"Lato, Helvetica, Arial, Verdana, sans-serif\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 15px;\">-Excellence: The quality of being outstanding or extremely good</span></font></p><p style=\"box-sizing: border-box; margin: 0px 0px 26px; color: rgb(33, 33, 33); font-family: &quot;Exo 2&quot;, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(249, 249, 249); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; line-height: 1;\"><font color=\"#676b6d\" face=\"Lato, Helvetica, Arial, Verdana, sans-serif\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 15px;\">-Diligence: Careful and persistent work and effort</span></font></p><p style=\"box-sizing: border-box; margin: 0px 0px 26px; color: rgb(33, 33, 33); font-family: &quot;Exo 2&quot;, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(249, 249, 249); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; line-height: 1;\"><font color=\"#676b6d\" face=\"Lato, Helvetica, Arial, Verdana, sans-serif\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 15px;\">-Integrity: The quality of being honest; being morally upright</span></font></p><p style=\"box-sizing: border-box; margin: 0px 0px 26px; color: rgb(33, 33, 33); font-family: &quot;Exo 2&quot;, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(249, 249, 249); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; line-height: 1;\"><font color=\"#676b6d\" face=\"Lato, Helvetica, Arial, Verdana, sans-serif\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 15px;\"><br></span></font></p><p style=\"box-sizing: border-box; margin: 0px 0px 26px; color: rgb(33, 33, 33); font-family: &quot;Exo 2&quot;, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(249, 249, 249); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; line-height: 1;\"><font color=\"#676b6d\" face=\"Lato, Helvetica, Arial, Verdana, sans-serif\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 15px;\"><br></span></font></p><p style=\"box-sizing: border-box; margin: 0px 0px 26px; color: rgb(33, 33, 33); font-family: &quot;Exo 2&quot;, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(249, 249, 249); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; line-height: 1;\"><img style=\"width: 600px;\" src=\"data:image/png;base64,\" data-filename=\"image.png\"><font color=\"#676b6d\" face=\"Lato, Helvetica, Arial, Verdana, sans-serif\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 15px;\"><br></span></font></p><div class=\"abt-title\" style=\"box-sizing: border-box; color: rgb(33, 33, 33); font-family: &quot;Exo 2&quot;, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><h3 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 20px !important; font-family: &quot;Exo 2&quot;, sans-serif; font-weight: 700; line-height: normal; color: rgb(57, 58, 148); font-size: 30px !important; margin-right: 0px; margin-left: 0px; padding-bottom: 16px !important; position: relative !important;\">Being Airborne Always Starts on the Ground</h3></div><div class=\"about-desc\" style=\"box-sizing: border-box; color: rgb(33, 33, 33); font-family: &quot;Exo 2&quot;, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><p style=\"box-sizing: border-box; margin: 0px 0px 26px;\"></p><p style=\"box-sizing: border-box; margin: 0px 0px 26px; color: rgb(102, 109, 129);\">When we established our training school in 2005, we only had two hobby aircrafts to service our students. We also had two students back then. Fresh in the industry, we were raring to traverse the aviation scene equipped with our dedication, knowledge and stern vision to succeed.</p><p style=\"box-sizing: border-box; margin: 0px; color: rgb(102, 109, 129);\">In only two years, students from neighboring countries have discovered our firm dedication to deliver first-rate training to those who wants to explore the skies. With our excellent performance we were able to take in 60 Pilot Training students in one batch. Thats the time we saw the need to veer out of the crowded skies of Metro Manila.</p><p style=\"box-sizing: border-box; margin: 0px; color: rgb(102, 109, 129);\"><br></p><p style=\"box-sizing: border-box; margin: 0px; color: rgb(102, 109, 129);\"><img style=\"width: 612px;\" src=\"data:image/png;base64,\" data-filename=\"image.png\"><br></p></div><p style=\"box-sizing: border-box; margin: 0px 0px 26px; color: rgb(33, 33, 33); font-family: &quot;Exo 2&quot;, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(249, 249, 249); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; line-height: 1;\"></p><p style=\"box-sizing: border-box; margin: 0px 0px 26px; color: rgb(33, 33, 33); font-family: &quot;Exo 2&quot;, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(249, 249, 249); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"></p><div class=\"abt-title\" style=\"box-sizing: border-box; color: rgb(33, 33, 33); font-family: &quot;Exo 2&quot;, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(249, 249, 249); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><h3 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 20px !important; font-family: &quot;Exo 2&quot;, sans-serif; font-weight: 700; line-height: normal; color: rgb(57, 58, 148); font-size: 30px !important; margin-right: 0px; margin-left: 0px; padding-bottom: 16px !important; position: relative !important;\">The New Home of WCC Aviation Company</h3></div><div class=\"about-desc\" style=\"box-sizing: border-box; color: rgb(33, 33, 33); font-family: &quot;Exo 2&quot;, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(249, 249, 249); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><p style=\"box-sizing: border-box; margin: 0px 0px 26px;\"></p><p style=\"box-sizing: border-box; margin: 0px 0px 26px;\"><span style=\"box-sizing: border-box; color: rgb(102, 109, 129);\">In 2008, the Binalonan Airfield served as the nesting ground of our aircraft and crew. Operated and services privately by us, we were able to master every aspect of flight operations which opened a whole new facet in aviation services and training.</span></p><p style=\"box-sizing: border-box; margin: 0px 0px 26px;\"><span style=\"box-sizing: border-box; color: rgb(102, 109, 129);\">Binalonan Airfield started offering flight services to business, individual, and flight training patrons, featuring an 850 meter north-south runway capable of handling general aviation and mid-sized commercial aircrafts. WCC Aviation Company, Inc. manages airport operations, including flight plans, aircraft maintenance, catering, fueling, and shuttle services. WCC AeroTech College was also founded on 2008, offering Diploma in Aircraft Maintenance Technology (AMT) as the second campus to offer AMT programs after the Caloocan campus (established in 2007).</span></p><div class=\"abt-title\" style=\"box-sizing: border-box; color: rgb(33, 33, 33); font-family: &quot;Exo 2&quot;, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><h3 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 20px !important; font-family: &quot;Exo 2&quot;, sans-serif; font-weight: 700; line-height: normal; color: rgb(57, 58, 148); font-size: 30px !important; margin-right: 0px; margin-left: 0px; padding-bottom: 16px !important; position: relative !important;\"><img style=\"width: 600px;\" src=\"data:image/png;base64,\" data-filename=\"image.png\"><br></h3><h3 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 20px !important; font-family: &quot;Exo 2&quot;, sans-serif; font-weight: 700; line-height: normal; color: rgb(57, 58, 148); font-size: 30px !important; margin-right: 0px; margin-left: 0px; padding-bottom: 16px !important; position: relative !important;\">The Most Comprehensive Aviation-Based School</h3></div><div class=\"about-desc\" style=\"box-sizing: border-box; color: rgb(33, 33, 33); font-family: &quot;Exo 2&quot;, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><p style=\"box-sizing: border-box; margin: 0px 0px 26px;\"></p><p style=\"box-sizing: border-box; margin: 0px 0px 26px; color: rgb(102, 109, 129);\">The Aircraft Maintenance and Flight Attendant Course were established on that same year. It catered to the growing need of the airline industry, local and abroad, for aviation professionals equipped with proper training and distinct knowledge in the airline operations.</p><p style=\"box-sizing: border-box; margin: 0px 0px 26px; color: rgb(102, 109, 129);\">Our Caloocan Campus served as the breeding ground for aircraft mechanics while our Quezon City Campus honed the safety skills of our flight attendant students. Three programs were added on 2010  BS Aviation, BS Aeronautical Engineering, and BS Tourism.</p><p style=\"box-sizing: border-box; margin: 0px; color: rgb(102, 109, 129);\">And as we complete our flight towards excellence and superiority, we open a new era of professional instructions, stand-out equipment and facilities, and courses and partners that are inclined towards the aviation and airline industries. There is no telling what the next years will behold us. However there is a bedrock certainty that WCC Aviation Company will maintain an unwavering commitment to strive for aviation excellence and conquer the skies with flying colors.</p></div><p style=\"box-sizing: border-box; margin: 0px 0px 26px;\"></p><p style=\"box-sizing: border-box; margin: 0px 0px 26px;\"><span style=\"box-sizing: border-box; color: rgb(102, 109, 129);\"><br></span></p></div><p class=\"MsoNormal\" style=\"box-sizing: border-box; margin: 0px 0px 0.0001pt; color: rgb(33, 33, 33); font-family: &quot;Exo 2&quot;, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(249, 249, 249); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; line-height: 24px;\"></p>', '2022-06-09 12:25:31', '2024-02-13 20:01:04');

